import React from "react";
import "../styles.css";

export default function Logger({ logs }) {
  if (!logs || logs.length === 0) {
    return <p className="empty-msg">No activity yet üìù</p>;
  }

  return (
    <div className="logger-container">
      <h2 className="logger-title">Activity Log</h2>
      <div className="logger-list">
        {logs.map((log, index) => (
          <div key={index} className="logger-item">
            <span className="logger-time">{log.time}</span>
            <span className="logger-event">{log.event}</span>
            {log.details && (
              <span className="logger-details">
                {typeof log.details === "string"
                  ? log.details
                  : JSON.stringify(log.details)}
              </span>
            )}
          </div>
        ))}
      </div>
    </div>
  );
}
